import React from "react";
import styled from "styled-components";
import heroImg from "../misc/images/hero2.png"

const HeroImg = styled.img`
  width: auto;
  height: 100vh;
  margin: 0;
`;

const HeroImgWrapper = styled.div`
  width: auto;
  height: 100%;
  margin: 0;
`;

function HeroImage() {
    return(
        <HeroImgWrapper>
            <HeroImage as="img" src={heroImg} alt="hero" />
        </HeroImgWrapper>
    )
}

export {HeroImg};
